  function fixDoneWords(allDoneWords) {
    let keys = Object.keys(allDoneWords);
    for(let i = 0; i < keys.length; i++){

      let k = keys[i];
      if(keys[i].indexOf('ё') !== -1){
        k = k.replace(/ё/g, 'е');
      }else if(k === "ассиметрия"){
        console.log('асс');
        k = "асимметрия";
      }
      let words = allDoneWords[keys[i]] || allDoneWords[k];

      if(words === 1){
        allDoneWords[k] = wordsFromWords[k];
        if(k === "асимметрия"){
          delete allDoneWords["ассиметрия"];
        }
      }else{
        if(keys[i].indexOf('ё')  !== -1){
          words = words.map((word)=>word.replace(/ё/g, 'е'));
        }

        delete allDoneWords[keys[i]];

        if(words.length > 0){
          let allWords = wordsFromWords[k];
          if(allWords){
            words = words.filter((word)=>allWords.includes(word));
            allDoneWords[k] = words;
          }

        }
      }


    }
    return allDoneWords;
  }
  if(allDoneWords){
    allDoneWords = fixDoneWords(JSON.parse(allDoneWords));
    tips = Number(tips);
    sounds = sounds === 'true';
    setLoc();
    isGameAdvShow = !isGameAdvShow;
  }else{
    allDoneWords = {};
    isGameAdvShow = false;
    isGameUpdate = false;
    tips = 3;
    isRules = true;
    sounds = true;
    localStorage.setItem('sounds', true);
    localStorage.setItem('allDoneWords', JSON.stringify(allDoneWords));
    localStorage.setItem('tips', 3);

    allWords.forEach((key => {
      allDoneWords[key] = [];
    }));
    for(let i = 0; i < allWords.length; i++){
      allStars.push(0);
    }
  }

  let recentState = JSON.stringify(PLAYESTATE);
  let recentStats = JSON.stringify(PLAYERSTATS);


  function setState(isNow) {
    const newData = JSON.stringify(PLAYESTATE);
    if(recentState === newData) return;
    console.log('setState');
    recentState = newData;
    if (playerGame) {
      //Если нет возможности сохранить в компрессованном виде, сохраняем в обычном
      if(cantSaveData){

        playerGame.setData(
            {
              allDoneWords: replaceLevelsToOne(PLAYESTATE.allDoneWords),
              cantSaveData: true
            }, isNow)
            .then((ignored) => {})
        return;
      }

      const newState = {
        allDoneWords: compressData(PLAYESTATE.allDoneWords)
      };

      playerGame.setData(newState, isNow).then((ignored) => {
      }).catch(() => {
        playerGame.setData(newState, isNow).then((ignored) => {
        }).catch(() => {
          playerGame.setData({allDoneWords: replaceLevelsToOne(PLAYESTATE.allDoneWords)}, isNow).then((ignored) => {
          }).catch(() => {
            localStorage.setItem('offline', '1');
          });
        })
      });

    }
  }
  function setStats(isNow) {
    const newData = JSON.stringify(PLAYERSTATS);
    if(recentStats === newData) return;
    recentStats = newData;
    if(playerGame) playerGame.setStats(PLAYERSTATS, isNow).then((ignored) => {}).catch(()=>{
      playerGame.setStats(PLAYERSTATS, isNow).then((ignored) => {})
    });
  }

  function saveAllData(isNow){
    console.log('saveAllData');
    setState(isNow);
    setStats(isNow);
  }

  window.onblur = () => saveAllData(true);
